INSERT INTO `quotes` (`id`, `quote`, `quoted_by`, `created_at`, `updated_at`) VALUES
(1, 'Your mind is for having ideas, not holding them.', 'David Allen', '2016-07-26 07:02:20', '0000-00-00 00:00:00'),
(2, 'Why do anything unless it is going to be great?', 'Peter Block', '2016-07-26 07:02:52', '0000-00-00 00:00:00'),
(3, 'Amateurs sit and wait for inspiration, the rest of us just get up and go to work.', 'Stephen King', '2016-07-26 07:15:14', '0000-00-00 00:00:00'),
(4, 'If you spend too much time thinking about a thing, you''ll never get it done.', 'Bruce Lee', '2016-07-26 07:15:14', '0000-00-00 00:00:00'),
(5, 'Create with the heart; build with the mind.', 'Criss Jami', '2016-07-26 07:18:09', '0000-00-00 00:00:00'),
(6, 'There is a light at the end of the tunnel, but the way out is through.', 'David Allen', '2016-07-26 07:18:09', '0000-00-00 00:00:00'),
(7, 'A project goal like a joke. If you have to explain it, it is not good / fun.', 'Gerry Geek', '2016-07-26 07:18:24', '0000-00-00 00:00:00'),
(8, 'If you want to get a meaningful result: create something very complex, and then simplify it.', 'Gerry Geek', '2016-07-26 07:21:50', '0000-00-00 00:00:00'),
(9, 'The way to get started is to quit talking and begin doing.', 'Walt Disney', '2016-07-26 07:21:50', '0000-00-00 00:00:00'),
(10, 'There is no substitute for hard work.', 'Thomas Edison', '2016-07-27 02:31:36', '0000-00-00 00:00:00'),
(11, 'Never mistake motion for action.', 'Ernest Hemingway', '2016-07-27 02:31:36', '0000-00-00 00:00:00'),
(12, 'My goal is no longer to get more done, but rather to have less to do.', 'Francine Jay', '2016-07-28 03:23:21', '0000-00-00 00:00:00'),
(13, 'On every level of life, from housework to heights of prayer, in all judgment and efforts to get things done, hurry and impatience are sure marks of the amateur.', 'Evelyn Underhill', '2016-07-28 03:23:21', '0000-00-00 00:00:00'),
(14, 'How poor are they that have not patience! What wound did ever heal but by degrees?', 'William Shakespeare', '2016-07-28 05:25:08', '0000-00-00 00:00:00'),
(15, 'You were born to win, but to be a winner, you must plan to win, prepare to win, and expect to win.', 'Zig Ziglar', '2016-07-28 05:19:23', '0000-00-00 00:00:00'),
(16, 'Sometimes, things may not go your way, but the effort should be there every single night.', 'Michael Jordan', '2016-07-28 05:21:09', '0000-00-00 00:00:00');
